  false,\n\t\"url\": null,\n\t\"notes\": \"Data regarding water withdrawals is collected
  by New York State Department of Environmental Conservation (DEC).  The reporting
  requirements have expanded since collection began in 1990. Data is currently collected
  in accordance with the requirements of ECL 15-1501. ECL 15-1501 requires a DEC permit
  and annual usage reporting for all facilities using water for any purpose and having
  the capacity to withdraw 100,000 gallons or more per day of surface or groundwater.
  These facilities may or may not be permitted with other agencies that regulate water
  supplies in New York State.  This dataset begins with 2009 data and includes facility
  name, town, county and withdrawal information.\",\n\t\"license_title\": \"License
